import java.math.*;


class ID1{
	/**
	* Creates a padding string of a certain length
	*/
	public static String createPadding(int length, char padChar){
		  // Pad string if length of string to be printed + number of characters to be printed is odd.
		  String str = "";

		  while (length + str.length() - 1 < 26){
			  // If not enough room in str.length, pad with empty spaces
			  if (length + str.length() < 1 ){
			  	length += str.length();
			  }
			  else{
			  	length += 1;
			  }
			  str += padChar;
		  }	
		  return str;

}
}

